INSERT INTO "product"(product_id, product_name, product_desc, brand_id, category_id, image)
VALUES
	(nextval('product_product_id_seq'::regclass), 'Sloan Ottoman', 'Sloan strikes an ideal balance between sleek and soft. The custom ottoman reflects a modern influence, yet is approachable and livable. It''s no wonder it feels right in a variety of decors, whether modern or more traditional.', 1, 11, 'https://content.cylindo.com/api/v2/4472/products/SLON.FABRIC.OTTO.STNDRD/frames/1/SLON.FABRIC.OTTO.STNDRD.JPG?background=FFFFFF&feature=COLOR:BI-132&feature=FINISH:LEG001-1'),
	(nextval('product_product_id_seq'::regclass), 'Tatum Leather Modular Square Ottoman', 'Thanks to its versatile, modular design, Tatum is customized to adapt to how you live - today and tomorrow. That means you can easily arrange (and rearrange) Tatum in as many configurations as you''d like with corner, armless, ottoman, and storage ottoman pieces. Tatum''s soft-but-structured design comes in the form of slimmed-down arms and added cushion softness in the back and seat, so you can sit comfortably no matter the configuration. With just four pieces and endless configuration possibilities, it''s safe to say that Tatum is truly our most customizable collection.', 7, 11, 'https://content.cylindo.com/api/v2/4472/products/TATM.LEATHR.UNIT.OTTOMAN/frames/1/TATM.LEATHR.UNIT.OTTOMAN.JPG?background=FFFFFF&feature=COLOR:8519A&feature=STORAGE:CLOSE'),
	(nextval('product_product_id_seq'::regclass), 'Maxwell Ottoman', 'The inspiration for Maxwell "was to take a traditional shape and make it fresh," says Apartment Therapy founder Maxwell Ryan, who co-created the custom ottoman with us. That means you''ll enjoy a shape that''s "comfy, cozy, and approachable." At the same time, it remains light and airy thanks to a thinner frame rail and turned leg.', 2, 11, 'https://content.cylindo.com/api/v2/4472/products/MXWL.FABRIC.OTTO.STNDRD/frames/1/MXWL.FABRIC.OTTO.STNDRD.JPG?background=FFFFFF&feature=COLOR:AK-618-16&feature=FINISH:LEG014-3'),
	(nextval('product_product_id_seq'::regclass), 'Colten Round Stool Ottoman', 'Colten''s rounded, clean shape makes for an understated accent piece that looks right at home anywhere.', 8, 12, 'https://content.cylindo.com/api/v2/4472/products/COLT.FABRIC.OTTO.STNDRD/frames/1/COLT.FABRIC.OTTO.STNDRD.JPG?background=FFFFFF&feature=COLOR:SE-170&feature=SIZE:20');
